The following snippet shows how you can best use of this property to show your
relative resources in your Windows form when you ship your windows application to
any where.


private void Form1_Load(object sender, EventArgs e)
{
htmlEditor1.BaseUrl = Application.StartupPath + "\\images";
}



Private Sub Form1_Load(ByVal sender As Object, ByVal e As EventArgs)
htmlEditor1.BaseUrl = Application.StartupPath &amp; "\images"
End Sub
